import React from 'react';

export default function Mode(props) {
	return (
		<div className='mode'>
			<div className='title'>{props.title}</div>
			<div className='icon'>
				<img src={props.icon}></img>
			</div>
			<div className='button'>
				<img src={require('../icons/arrow-right.svg')}></img>
			</div>
		</div>
	);
}
